import React, { useState} from 'react';
import { CircularProgress, Grid, Typography, InputLabel, MenuItem, FormControl, Select, Card, Avatar } from '@material-ui/core';
import PlaceDetails from '../PlaceDetails/PlaceDetails';
import useStyles from './style';

function List() {
  const classes = useStyles();
  const [type, setType] = useState('hotels');
  const [rating, setRating] = useState('');

  const places = [
    {name: 'Johannesburg'},
    {name: 'Durban'},
    {name: 'Cape Town'},
    {name: 'Johannesburg'},
    {name: 'Durban'},
    {name: 'Cape Town'},
    {name: 'Johannesburg'},
    {name: 'Durban'},
    {name: 'Cape Town'}
  ]

  return (
    <div className={classes.container}>
      <Avatar 
      alt="Kritika Goel" 
      src="https://thenewscrunch.com/wp-content/uploads/2020/08/Kritika-Goel.jpg" 
      sx={{ width: 56, height: 56 }}
      />
      <Typography variant="p">Created by</Typography>
      <Typography variant="button"><br/>Kritika Goel</Typography>
      <Typography variant="h6"><br/>Hotels Around You</Typography>
      <FormControl className={classes.formControl}>
        <InputLabel>Type</InputLabel>
        <Select value={type} onChange={(e) => setType(e.target.value)}>
          <MenuItem value="hotels">Hotels</MenuItem>
        </Select>
      </FormControl>
      <FormControl className={classes.formControl}>
        <InputLabel>Rating</InputLabel>
        <Select value={rating} onChange={(e) => setRating(e.target.value)}>
          <MenuItem value={0}>All Rating</MenuItem>
          <MenuItem value={3}>Above 3.0</MenuItem>
          <MenuItem value={4}>Above 4.0</MenuItem>
          <MenuItem value={4.5}>Above 4.5</MenuItem>
        </Select>
      </FormControl>
      <Grid container spacing={3} className={classes.list}>
        {places?.map((place, i) => (
          <Grid item key={i} xs={12}>
            <PlaceDetails place={place}/>
          </Grid>
        ))}
      </Grid>
    </div>
  );
}

export default List;
